import React, { Component } from 'react';
import banner3 from './assets/banner3.png'

class Memberships extends React.Component{
    
    render() {

        let membershipBanner = <img src={banner3} alt='banner3' className='bkgrnd'/>

        let economyMem = "https://dashboard.globeboarding.com/purchase/wLldB5KVNFF294hcgNp6R?password=ECONOMY"
        let centurionMem = "https://dashboard.globeboarding.com/purchase/u9SukdAhI-dZDv_IMOmE9?password=CENTURION"
        let centurionButton = <a href={centurionMem} target="_blank"> <button type="button" className="btn-circle "><span> Subscribe </span></button> </a>
        let economyButton = <a href={centurionMem} target="_blank"> <button type="button" className="btn-circle "><span> Subscribe </span></button> </a>

    return (
        <div className="banners" id="memberships"> 
          <section className="parent-bg">
          {membershipBanner}
          <div className="square-mems">
                <div className="grid-container-features">
                <div className="grid-item"><h3>Economy</h3><p>Our Economy plan is well suited for all levels of travel. Booking just one of our deals will likely pay for your membership for up to a decade or more.</p>{centurionButton}</div>
                <div className="grid-item-blue"><h3>Centurion</h3><p>Centurion is great for both the first time traveler and the vastly experienced traveler. If you need extra help setting up your first trip, or want the most exclusive deals to truly see the world, Centurion is for you. </p>{economyButton}</div>
            </div>
            </div>
        </section>
        </div>
      );

    }

}
export default Memberships;
